import React from "react";


const Movie = ()=>{
    const options = {
        method: 'GET',
        headers: {
            'X-RapidAPI-Key': 'f1d641037bmsh805777c136ad783p142fecjsn73217d65f347',
            'X-RapidAPI-Host': 'netflix-weekly-top-10.p.rapidapi.com'
        }
    };   
    const handleclick = async ()=>{
        fetch('https://netflix-weekly-top-10.p.rapidapi.com/api/movie', options)
        await (response => response.json())
        await (response => console.log(response))
        
        

    }


    return(
        <div>
            <div>Movie</div>
            <div className="box"></div>
            <button className="btn" onClick={handleclick}>Button</button>
        </div>
            
    )
    
   
}

export default Movie;
